import { useNavigate } from "react-router-dom";
import HeaderContainer from "./style";
import logo from "../../assets/pokemonLogo.svg";

function Header({ buttonGoTo, childrenButtonGoTo }) {
    useNavigate= useNavigate()
  return (
    <HeaderContainer>
      <buttonReturnPage></buttonReturnPage>
      <img src={logo} alt="" />
      <buttonGoToPage onClik={buttonGoTo}>{childrenButtonGoTo}</buttonGoToPage>
    </HeaderContainer>
  );
}
export default Header;
